import Button from 'react-bootstrap/Button';

const SurveyPart3 = () => {

    function contactMe() {
        const data = {
            email: document.getElementById('email').value
        }

        fetch("https://stormy-plains-42247.herokuapp.com/sendContactInfo", {
            mode: "cors",
            method: "POST",
            headers: {
                'Content-type': "application/json"
            },
            body: JSON.stringify(data)
        }).then(function(response) {
            document.getElementById("sentEmail").innerHTML = "Din e-post är mottagen!";
            return response.json();
        }); 
    }

    return (
        <div id="SurveyPart3">
            <h2>Stort tack för din medverkan i vår enkät.</h2>
            <h2>Dina svar är inskickade och du kan nu lämna sidan om du vill!</h2> 
            <br>
            </br>
            <p>
                Vi vill återigen intyga att vi inte sparar någon information annat än dina enkätsvar, 
                <br>
                </br>
                samt ett identifierings-ID kopplat till din inloggning för att undvika flera svar från samma person.</p>
            <br>
            </br>
        </div>
    )
}

export default SurveyPart3;
